const insertStampWithHtml = ({html, color, img}: {html: string, color: string, img: string}): string =>
{
    let retHtml = html

    const regex = /\(서명 또는 인\)/g;
    const matches: number[] = [];
    let match;
    while ((match = regex.exec(retHtml)) !== null)
        matches.push(match.index);

    if (matches.length === 0)
        return html;

    // 문자열 배열 변환
    let htmlArr = retHtml.split('');
    const targetLength = '(서명 또는 인)'.length;

    const imgSpanOpen = `<span style="
        background-image: url(${img});
        background-repeat: no-repeat;
        background-size: contain;
        background-position: center top;
        opacity: 0.5;
        display: inline-block;
        vertical-align: middle;
        white-space: nowrap;
        width: fit-content;
        height: auto;
    ">`;
    const spanClose = '</span>';
    const stampSpanTag = `<span style="background-color: ${color}; white-space: nowrap;">(서명 또는 인)</span>`;

    htmlArr.splice(matches[0], targetLength, imgSpanOpen + stampSpanTag + spanClose);

    for (let i = matches.length - 1; i >= 1; i--) {
        const pos = matches[i] - (targetLength - 1);
        htmlArr.splice(pos, targetLength, stampSpanTag);
    }

    return htmlArr.join('');
}

